INSERT INTO `glasses` VALUES (1,'Square Glasses 4430016','These fashion-forward square glasses have a lovely hint of translucent color. The medium-sized, high-quality frame is made with acetate that is hand-polished to a glossy finish. It is available in the following colors: translucent pink with a hint of lilac and blue with a hint of brown. Spring hinges provide a comfortable fit.',32.95,'//static.zennioptical.com/production/products/general/44/30/4430016-eyeglasses-front-view.jpg?im=Resize,width=800',4.5,1),(2,'Browline Glasses 321914','This line of vintage-inspired eyewear merges contemporary colors and details with antique finishes. This wide browline frame is made with stainless steel. The temple arms feature ribbed detailing and acetate temple tips for added comfort.',32.95,'//static.zennioptical.com/production/products/general/32/19/321914-eyeglasses-front-view.jpg?im=Resize,width=800',4.1,2),(3,'Square Glasses 3216819','These stylish square glasses have a classic shape with a modern edge. The medium-sized frame is available in shiny rose gold, shiny red, satin purple, and matte black. Adjustable nose pads provide a comfortable fit.',19.95,'//static.zennioptical.com/production/products/general/32/16/3216819-eyeglasses-front-view.jpg?im=Resize,width=800',4.4,3),(4,'Round Glasses 3216721','These contemporary round glasses are a fun choice for everyday glasses. The medium-narrow metal frame features a keyhole bridge and is available in the following colorways: matte black, metallic red, pink, and metallic purple. Acetate temple tips and adjustable nose pads provide a comfortable wear.',19.95,'//static.zennioptical.com/production/products/general/32/16/3216721-eyeglasses-front-view.jpg?im=Resize,width=800',4.2,4),(5,'Cat-Eye Glasses 2018723','These cat-eye glasses offer incredible comfort and style at an unbeatable price. Made with lightweight TR90 plastic, this medium-wide frame is available in the following glossy options: translucent pink, pink, black floral, floral on clear, and polka dot. This style also comes in a',12.95,'//static.zennioptical.com/production/products/general/20/18/2018723-eyeglasses-front-view.jpg?im=Resize,width=800',4.6,5),(6,'Baltic 2038825','Part of our ReMakes sustainable eyewear collection, Baltic is a modern take on classic round glasses made with 100% certified recycled post-consumer plastic. The lightweight matte frame features a timeless double metal dot detail at the corners wears comfortably all day.',39.95,'//static.zennioptical.com/production/products/general/20/38/2038825-eyeglasses-front-view.jpg?im=Resize,width=800',4.4,6),(7,'Square Glasses 3218621','These stylish square glasses feature thin metal rims and twisted metal temple arms. The larger lenses also look great with one of our fashion tints. The medium-wide frame is available in ultraviolet with silver temple arms, and black with gold temple arms. Adjustable nose pads provide a comfortable fit.',23.95,'//static.zennioptical.com/production/products/general/32/18/3218621-eyeglasses-front-view.jpg?im=Resize,width=800',4.5,7),(8,'Rectangle Glasses 2027315','These chic rectangle glasses offer exceptional style and value. The medium-sized translucent frame is made with lightweight TR90 plastic for all-day comfort. It has a glossy finish and comes in the following options: cherry, brown, and black/clear pattern. Spring hinges provide added comfort.',12.95,'//static.zennioptical.com/production/products/general/20/27/2027315-eyeglasses-front-view.jpg?im=Resize,width=800',4.6,8),(9,'Square Glasses 662916','Create just the right amount of impact in these simplistic square glasses. Made from our thinnest acetate, the glossy frame is both durable and lightweight. The look shines with minimal details and clean design lines, so the focus is entirely on you.',19.95,'//static.zennioptical.com/production/products/general/66/29/662916-eyeglasses-front-view.jpg?im=Resize,width=800',4.5,9),(10,'Aviator Glasses 3228924','Choose a fresh take on a classic style in these colorful aviator glasses. The stainless steel frame is accented with a chic raised brow bar. For added comfort, the style is fitted with adjustable nose pads, acetate temple tips, and spring hinges.',29.95,'//static.zennioptical.com/production/products/general/32/28/3228924-eyeglasses-front-view.jpg?im=Resize,width=800',NULL,10),(11,'Titanium Rectangle Glasses 195112','Merging fashion and function with clean lines, meticulous details, and lightweight comfort, this edgy rectangle frame is a great choice for everyday glasses. Constructed with durable titanium, this wide frame has a satin-finished front rim. Adjustable silicone nose pads and flexible TR90 temple arms provide added comfort. It is available in the following colors: gray, brown, and navy.',35.95,'//static.zennioptical.com/production/products/general/19/51/195112-eyeglasses-front-view.jpg?im=Resize,width=800',4.1,11),(12,'Browline Glasses 3213911','These contemporary browline glasses are a must for any smart wardrobe. The medium-narrow frame features a stainless steel brow and temple arms, with a subtle stamped pattern. Acetate temple tips, adjustable nose pads, and spring hinges provide a comfortable fit. This frame has a satin finish and is available in silver or gold.',27.95,'//static.zennioptical.com/production/products/general/32/13/3213911-eyeglasses-front-view.jpg?im=Resize,width=800',4.2,12),(13,'Square Glasses 2031721','Plastic is fantastic in these classic square glasses. The matte frame is made from lightweight TR90 plastic and has comfort features like extended fit, soft nose pads, and spring hinges. It is available in black, clear, and red with black temple arms, or brown with brown temple arms, and blue with navy temple arms.',23.95,'//static.zennioptical.com/production/products/general/20/31/2031721-eyeglasses-front-view.jpg?im=Resize,width=800',3.7,13),(14,'Rectangle Glasses 153021','This is it. Your classic, full-rim, rectangular, metal Men\'s eyeglasses frame. It comes in brown or black and features silicone nose pads so you can secure the glasses comfortably on your nose. Little spots of color on the tips of the acetate temple sleeves lift this frame out of the neighborhood of boring and into the realm of the subtly stylish.',15.95,'//static.zennioptical.com/production/products/general/15/30/153021-eyeglasses-front-view.jpg?im=Resize,width=800',4.5,14),(15,'Skyline 4422423','Embrace earth tones in these stylish round glasses, which are part of our collection honoring those who are',25.95,'//static.zennioptical.com/production/products/general/44/22/4422423-eyeglasses-front-view.jpg?im=Resize,width=800',4.5,15),(16,'Ocotillo Round Glasses 327912','Part of our Desert Collection, Ocotillo is a round frame with refined angles on the top rim that were inspired by the geological shapes found in the desert. Made with stainless steel, the medium-sized frame comes in two glossy color options: black with bronze accents or black with graphite (dark gray) accents.',25.95,'//static.zennioptical.com/production/products/general/32/79/327912-eyeglasses-front-view.jpg?im=Resize,width=800',4.2,16),(17,'Geometric Glasses 3237714','Enjoy a fresh twist on a classic round frame in with these minimalist geometric glasses. The shiny stainless steel frame features wire thin rims, nose bridge, and memory titanium temple arms. Soft plastic temple tips and adjustable nose pads provide added comfort.',29.95,'//static.zennioptical.com/production/products/general/32/37/3237714-eyeglasses-front-view.jpg?im=Resize,width=800',5.0,17),(18,'Rimless Glasses 466521','Simple and chic, this ultra-lightweight frame makes for great rimless glasses. The temple arms feature a diagonal line detail. For added comfort, the look has adjustable nose pads and soft plastic temple tips.\nPlease refer to the “SELECT SHAPE” button above to see the different lens shapes and sizes available for this frame. Please note, the overall look and final size of the frame will change depending on which lenses are selected. After a lens is selected, the lens model number and lens width/height will be displayed.',23.95,'//static.zennioptical.com/production/products/general/46/65/466521-eyeglasses-front-view.jpg?im=Resize,width=800',4.1,18),(19,'Heart-Shaped Glasses 4420221','Love at first sight! These are the first commercially available prescription heart-shaped glasses and sunglasses. Made with high-quality acetate, this wide, sturdy frame comes in three color options: glossy red, glossy white, and matte black. It features spring hinges for a comfortable fit.',19.95,'//static.zennioptical.com/production/products/general/44/20/4420221-eyeglasses-front-view.jpg?im=Resize,width=800',4.6,19),(20,'Aviator Glasses 1301114','Show your attention to detail in these modern aviator glasses. The break-resistant titanium frame is accented with a waved metal brow bar. For added comfort, the lightweight look has adjustable nose pads and soft plastic temple tips.',49.95,'//static.zennioptical.com/production/products/general/13/01/1301114-eyeglasses-front-view.jpg?im=Resize,width=800',4.2,20),(21,'Kids\' Rectangle Glasses 4448112','The glossy acetate frame features colorful accents and interior core. The look is fitted with spring hinges and TR90 plastic temple tips for added comfort. It comes in the following color ways: black with red accents, clear with blue accents, slate with neon green accents, and orange with yellow accents.',32.95,'//static.zennioptical.com/production/products/general/44/48/4448112-eyeglasses-front-view.jpg?im=Resize,width=800',4.1,21),(22,'Kids\' Square Glasses 4456923','Match your little one\'s glasses with their personality in these adorable kids\' square glasses. Made from glossy hand-polished acetate, the stylish frame is lightweight and sturdy with slim temple arms.',25.95,'//static.zennioptical.com/production/products/general/44/56/4456923-eyeglasses-front-view.jpg?im=Resize,width=800',3.6,22),(23,'Kids\' Square Glasses 4450517','Add just the right vibes to a classic style with these colorful kids\' square glasses. Made from glossy hand-polished acetate, the frame is an ideal candidate for both glasses and sunglasses. This look features a universal bridge fit, which is designed to stay off the cheekbones and not slide down the nose. For added comfort, the look is fitted with spring hinges. It is available in the following colors: beachside and wavelength.',25.95,'//static.zennioptical.com/production/products/general/44/50/4450517-eyeglasses-front-view.jpg?im=Resize,width=800',5.0,23),(24,'Kids\' Round Glasses 2034123','The glossy acetate frame features a raised rim around the lens, along with a triple metal dot detail at the temples. The look comes in three color ways: blue, black with clear accents, or clear with tortoise accents.',25.95,'//static.zennioptical.com/production/products/general/20/34/2034123-eyeglasses-front-view.jpg?im=Resize,width=800',4.8,24),(25,'Kids\' Round Glasses 4455417','Add a feline twist to your eyewear in these fun kids\' round glasses. Made from glossy hand-polished acetate, the frame features tortoiseshell cat ear-shaped accents at the corners and on the temple arms.',29.95,'//static.zennioptical.com/production/products/general/44/55/4455417-eyeglasses-front-view.jpg?im=Resize,width=800',5.0,25),(26,'Vinyl Glasses','Show off your unique style with Vinyl, a mixed material frame with a straightforward look. Featuring a full-rim face front constructed of translucent acetate, with textured metal arms in rose gold. These modern specs will make sure you’re looking your best, no matter what you decide to pair them with.',45.00,'https://img.ebdcdn.com/product/frame/gray/pm0982_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.6,1),(27,'Aura Glasses','Pop the cork on these Matte Champagne colored eyeglasses! The soft and unique finish on this frame is stylish and distinctive, while the double studs and keyhole nose bridge add even more to their chic aesthetic. This medium sized frame is super adaptable and perfect for any occasion.',70.00,'https://img.ebdcdn.com/product/frame/gray/pl5418_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,2),(28,'Intense Glasses','Show up and stand out in a new limited-edition summer color. We call it Intense for a reason, with flaming coral frames and contrasting tortoiseshell arms. Classically square-shaped, featuring a stand-out browline and mixed material construction with metal and acetate. The adjustable nose pads make this style suitable for any face shape or size.',55.00,'https://img.ebdcdn.com/product/frame/gray/mt7052_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,3),(29,'Ember Glasses','This Matte Black frame is great for men or women. The narrow, oversized lens frames are both on-trend and classic, while the lightweight design ensures they comfortable and comfortable to wear throughout the day. Ember is an adaptable frame that suits both casual and formal outfits.',22.00,'https://img.ebdcdn.com/product/frame/gray/mt6507_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,4),(30,'Dutchess Glasses','Ever dreamed of being the Duchess of York? No? What about a smaller dream, maybe passing the dutchie on the left hand side? Also no? Well how about just wearing some stylish \"Dutchess\" full-rimmed eyeglasses for women? Yes, that sounds perfect to us too. They are round shaped plastic and stamped with an intricate floral pattern, being fashionable has never been an easier dream to achieve.',9.00,'https://img.ebdcdn.com/product/frame/gray/pl6617_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,5),(31,'Intense Glasses','A strong look suited for just about any style, Intense is a square frame featuring a lustrous gold face front with a modern matte finish, and timeless tortoiseshell arms made from acetate. Designed with an emphasized browline to highlight your best features, and adjustable nose pads for a custom fit.',55.00,'https://img.ebdcdn.com/product/frame/gray/pm0988_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,6),(32,'Movement Glasses','Take the first step with Movement in Gold. This glamorous, larger than life metal frame simply oozes style.',39.00,'https://img.ebdcdn.com/product/frame/gray/mt6689_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.9,7),(33,'Notting Hill Glasses','Add some glamour and sophistication with tortoise eyeglasses. This luxurious frame comes in a semi-transparent tortoiseshell acetate finish throughout and features rounded trapezoid-shaped lenses. A keyhole nose bridge and double stud accents add a vintage feel. Flexible spring hinges means you won’t have to sacrifice comfort for style.',39.00,'https://img.ebdcdn.com/product/frame/gray/pl4961_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.9,8),(34,'Amity Glasses','Amity\'s full-rimmed frame and sleek round lenses represents decades of femme-forward eyewear fashion. In Clear Purple, this crystal-like frame is an excellent fit for any face shape — regardless of size.',29.00,'https://img.ebdcdn.com/product/frame/gray/pm0601_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,9),(35,'Nantes Glasses','Normalize the aviator style with these silver eyeglasses. This sharp style comes in a glossy silver metal finish and exaggerated square shaped lenses. Oversized lenses, double nose bridge, adjustable nose pads, and acetate arm tips make this trendy style suitable for everyday wear.',35.00,'https://img.ebdcdn.com/product/frame/gray/mt6161_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,10),(36,'Ray-Ban RB5279','This classic look from Ray-Ban has no shortage of style, featuring the perfect blend of retro and modern design elements. The timeless rectangluar lenses are surrounded by sleek acetate in a chic gray gradient, complete with spring hinges for added comfort.',167.00,'https://img.ebdcdn.com/product/frame/gray/lupl01484_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',5.0,11),(37,'Coexist Glasses','Look sharp with these black and silver eyeglasses. This browlline style frame comes in a glossy black acetate and silver metal accents. The classic retro style, square shaped lenses, and single stud accents create a strong look for both men and women.',25.00,'https://img.ebdcdn.com/product/frame/gray/pl5316_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,12),(38,'Sam Glasses','Be bold with Sam in black. This style is no-nonsense and classic, while spring hinges do their part to ensure maximum comfort.',45.00,'https://img.ebdcdn.com/product/frame/gray/pl5695_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,13),(39,'Manchester Glasses','Manchester\'s unique all metal browline design is accented with a deep Black finish and smooth acetate temple tips. This modern take on a classic will turn heads. The spring hinges featured on this frame keep them comfortable and adaptable to any face shape.',35.00,'https://img.ebdcdn.com/product/frame/gray/mt6249_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,14),(40,'New Day Glasses','Step into the future of fashion with these New Day eyeglasses. This stylish design, with gently curved, full-rim lenses and elegant, slender temples, is given a striking twist by the clear plastic material, with the metal skeleton of the frame clearly visible underneath. This daring look will go perfectly with any color clothes and will add a real X factor to your outfit.',45.00,'https://img.ebdcdn.com/product/frame/gray/pl6256_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.8,15),(41,'St Michel Glasses','Sleek and sincere, the patron saint of style is here to stay...on your face. Don\'t be deceived by the delicate-looking slender black metal wire frames–St Michel is a style powerhouse, delivering striking looks with a light touch.',39.00,'https://img.ebdcdn.com/product/frame/gray/mt6565_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.9,16),(42,'Music Glasses','Music is an elegant frame fit for those who like a refined style. The geometric shape makes a statement without saying too much, allowing your personal style to speak for itself. The delicate metal details in gold complement the black eyewire and acetate arms. With adjustable nose pads for a custom fit.',45.00,'https://img.ebdcdn.com/product/frame/gray/mt7246_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',5.0,17),(43,'Ray-Ban RB8724','Rethink your style and refresh your frames with this rimless classic from Ray-Ban. Featuring an overall minimal design with wide rectangular lenses and slightly stylized arms for a balanced look. The lightweight titanium hardware, subtle nose bridge, and barely-there embossed logo add a touch of modern design to these otherwise traditional glasses.',236.00,'https://img.ebdcdn.com/product/frame/gray/lutt00199_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',NULL,18),(44,'Amore Glasses','That’s Amore! These too-cute rimless glasses will change your outlook with a little love, and a lot of style. This lightweight look features subtle temples in lustrous gold metal, always on trend tortoiseshell temple tips, and adjustable nose pads for a secure and comfortable fit you can’t help falling for.',35.00,'https://img.ebdcdn.com/product/frame/gray/rm3121_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.9,19),(45,'Ray-Ban RB3625V New Aviator','Inspired by the original aviator style and crafted with a timeless metal design, these Ray-Ban frames are your ticket to vintage luxury. Crafted from quality materials, they feature a gold metal frame and tortoiseshell temple tips. Perfect for anyone who’s looking for that extra touch of sophistication.',200.00,'https://img.ebdcdn.com/product/frame/gray/lumt00990_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',NULL,20),(46,'Saturn Glasses','Looking for the coolest glasses in the universe? Meet Saturn. This trendy look is perfect for your little one with big style, featuring a full-rim acetate construction that shows off a mulberry face front met with ivory tortoise arms. Designed with spring hinges for a look that\'s as comfortable as it is stylish.',35.00,'https://img.ebdcdn.com/product/frame/gray/pl7963_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',5.0,21),(47,'Clever Glasses','Let\'s be clear: we don\'t always see eye to eye with our kids, especially when it comes to eyewear. We\'ll make sure they look cool and Clever in these translucent kids\' frames with grown-up fashion sense. Perfect for work or play, these see-through glasses are built to last and go with everything.',45.00,'https://img.ebdcdn.com/product/frame/gray/pm0821_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',5.0,22),(48,'Leap Glasses','Make room for the new cool kid in town! Leap is a modern frame that impresses with its blue finish and rectangle design. The lightweight acetate construction and spring hinges make it extra comfortable for both girls and boys.',35.00,'https://img.ebdcdn.com/product/frame/gray/pl7400_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.9,23),(49,'Solver Glasses','Kids don\'t want glasses that look like they were made for children. The answer to their problems is Solver– frames sophisticated enough for any adult, but made for our smallest customers. Crystal-clear acetate with exposed metal temples is trendy, durable, and goes with everything.',39.00,'https://img.ebdcdn.com/product/frame/gray/pm0814_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',4.1,24),(50,'Little Charlotte Glasses','You’re never too young to convey some cool confidence, and this one is for the girls! The Little Charlotte in pretty Pink lets kids show off their feminine fierceness. These cat-eyed lenses with horned rims are a classic choice for the kid who is studious, sporty or both!',35.00,'https://img.ebdcdn.com/product/frame/gray/pl7372_0.jpg?im=Resize,width=600,height=300,aspect=fill;UnsharpMask,sigma=1.0,gain=1.0&q=85',5.0,25);
